import React, { useEffect } from "react";
import CommonTable from "../components/common/CommonTable";
import AddVehicleDialog from "../components/forms/addVehicle";
import { Vehicle_Api } from "../api/vehicle_api";
import BPNotification from "../components/common/BPNotification";

const HeaderValue = ["Vendor Name", "Mobile", "Email", "Location"];

const Vehicle = () => {
  const [modalOpen, setmodalOpen] = React.useState(false);
  const [successModal, setSuccessModal] = React.useState(false);
  const [data, setData] = React.useState([]);

  const addVehicle = () => {
    console.log("clicked");
    setmodalOpen(!modalOpen);
  };

  const closeModal = () => {
    setmodalOpen(!modalOpen);
  };

  const getData = async () => {
    console.log("res");
    const res = await Vehicle_Api.Get_Vehicle();
    console.log(res);
    if (res.code == 200) {
      setData(res.data.res.data);
    } else {
      return [];
    }
  };

  const submit = async fields => {
    const res = await Vehicle_Api.Add_Vehicle(fields);
    console.log(res);
  };

  useEffect(() => {
    getData();
  });

  return (
    <React.Fragment>
      <CommonTable
        Header={HeaderValue}
        data={data}
        buttonLabel={"Add Vendor"}
        onClick={() => addVehicle()}
      />
      {modalOpen && (
        <AddVehicleDialog
          closeModal={closeModal}
          submit={fields => submit(fields)}
        />
      )}
      {successModal && <BPNotification message={"message"} />}
    </React.Fragment>
  );
};

export default Vehicle;
